users—>chat_platoform\n                'user_id' => $userData['chat_user_id'], //берется из БД, users—>chat_user_id\n                'key' => 'uavyicybfiaygisbci628345dxfabvydsfua', //захардкоженное значение, всегда должно быть равно uavyicybfiaygisbci628345dxfabvydsfua, иначе не будет работать\n            )\n        );\n        \n        $opts = array('http' =>\n            array(\n                'method'  => 'POST',\n                'header'  => 'Content-type: application/x-www-form-urlencoded',\n                'content' => $postdata\n            )\n        );\n        \n        $context  = stream_context_create($opts);\n        \n        $result = file_get_contents('http://test-calvin.alef.im/api.php', false, $context);\n    }\n    \n}\n\n","default_sort_order":"desc"}},{"name":"Свидания","icon":"calendar","id":"a4889786-3227-4999-a80a-ef4187c0157a","params":{"type":"table","name":"Свидания","file_name":"dates.php","icon":"calendar","x":"533.328125px","y":"150px","select_from":"_dates_info","update_and_insert":"dates","roles":"admin,coordinator","can_create":1,"can_delete":1,"can_edit":1,"pagination":1,"default_sort":"dt","default_sort_order":"desc","visible":1,"control-container-columns":[{"type":"table-none","name":"ID","id":"06ec2dee-dac3-49d7-b093-32ff46b4b176","mysql":"id"},{"type":"table-none","name":"Парень","id":"7e764e40-812f-4340-ab93-e93616bd1ceb","mysql":"male_name","query":"SELECT name as text, id as value FROM users where sex='male'","filter":"text"},{"type":"table-none","name":"тел.","id":"6c67011d-10f8-48b1-a014-318397581ca8","mysql":"male_phone"},{"type":"table-date","name":"Дата","id":"1d4b9ca9-7537-4bfb-8a31-df3772f18fda","mysql":"dt","filter":"date"},{"type":"table-none","name":"Девушка","id":"0e14f02c-cbe9-481e-9076-157cbbea4a70","mysql":"female_name","query":"SELECT name as text, id as value FROM users where sex='female'","filter":"text"},{"type":"table-none","name":"тел.","id":"2c60492f-c402-4ec0-add0-fa83f03de91c","mysql":"female_phone"